// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

interface IERC20 {
    function transferFrom(address from, address to, uint256 amount) external returns (bool);
    function transfer(address to, uint256 amount) external returns (bool);
}

contract DocPayGo {
    struct Doc {
        address author;
        string arweaveTx;
        string title;
        string mime;
        uint256 sizeBytes;
        uint256 timestamp;
    }

    mapping(bytes32 => Doc) public docs;

    event DocumentPosted(
        address indexed author,
        bytes32 indexed docId,
        string arweaveTx,
        uint256 sizeBytes,
        uint256 timestamp
    );

    address public owner;
    IERC20 public immutable token;

    uint256 public constant FREE_QUOTA_MB = 5;
    uint256 public constant PROC_FEE_CENTS = 1;
    uint256 public constant ARWEAVE_RATE_CENTS = 15;
    uint256 public constant MARKUP_BPS = 50000; // 500% = x6 total
    uint256 public constant CENT_TO_USDC = 1e4; // 1 cent = 0.01 USDC = 10,000 (6 decimals)

    bool private locked;

    modifier onlyOwner() {
        require(msg.sender == owner, "not owner");
        _;
    }

    modifier nonReentrant() {
        require(!locked, "reentrant");
        locked = true;
        _;
        locked = false;
    }

    constructor(address _token) {
        require(_token != address(0), "token=0");
        owner = msg.sender;
        token = IERC20(_token);
    }

    function post(
        string calldata arTx,
        string calldata title,
        string calldata mime,
        uint256 sizeBytes,
        uint256 priceCents
    ) external nonReentrant {
        require(bytes(arTx).length > 0, "arTx empty");
        require(sizeBytes > 0, "sizeBytes=0");

        uint256 totalCents = _calculateTotalCents(sizeBytes);
        require(totalCents == priceCents, "price mismatch");

        uint256 usdcToPull = totalCents * CENT_TO_USDC;
        require(token.transferFrom(msg.sender, address(this), usdcToPull), "payment failed");

        bytes32 id = keccak256(abi.encodePacked(arTx));
        require(docs[id].author == address(0), "already posted");
        docs[id] = Doc(msg.sender, arTx, title, mime, sizeBytes, block.timestamp);

        emit DocumentPosted(msg.sender, id, arTx, sizeBytes, block.timestamp);
    }

    function _calculateTotalCents(uint256 sizeBytes) internal pure returns (uint256) {
        uint256 sizeMb = (sizeBytes + 1e6 - 1) / 1e6;
        uint256 rawCents = PROC_FEE_CENTS;
        if (sizeMb > FREE_QUOTA_MB) {
            uint256 excessMb = sizeMb - FREE_QUOTA_MB;
            rawCents += excessMb * ARWEAVE_RATE_CENTS;
        }
        uint256 markupCents = (rawCents * MARKUP_BPS) / 10000;
        return rawCents + markupCents;
    }

    function withdraw(address to, uint256 amount) external onlyOwner nonReentrant {
        require(to != address(0), "bad to");
        require(token.transfer(to, amount), "withdraw failed");
    }
}

